            if (!(c = input()) || c == -1)
                return TOKEN_COMMENT;
            clexreal_column++;
            if (c == '\n' || c == '\r')
            {
                clexreal_column = 0;
                clex_column = 0;
                clex_lineno++;
            }
            if (c == '/')
                return TOKEN_COMMENT;
            else
            {
                char tmp[2] = { '*', c };
                accumulate_comment(tmp, sizeof(tmp));
            }
