int preprocessor(void)
{
    char    c;

    while ((c = input()) && c != -1)
    {
        clexreal_column++;
        if (c == '\n')
        {
            clex_lineno++;
            clexreal_column = 0;
            clex_column = 0;
            break;
        }
        if (c == '\r')
        {
            clex_lineno++;
            clexreal_column = 0;
            clex_column = 0;
        }

        /* handle multi-line comments beginning on a preprocessor line */
        if (c == '/')
        {
            if (!(c = input()) || c == -1)
                break;
            clexreal_column++;
            if (c == '*')
            {
                int save_lineno = clex_lineno;

                cstyle_comment();
                if (clex_lineno != save_lineno)
                    return TOKEN_COMMENT;
                continue;
            }
            clexreal_column--;
            unput(c);
        }
    }

    return TOKEN_JUNK;
}

